import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { Nav, Navbar } from 'react-bootstrap';
import './Nav_Bar.css';
import { Link } from 'react-router-dom';
import { lightBlue } from '@mui/material/colors';

const Nav_Bar = () => {
  return (
    <div className="nav_Bar_Font">
      <Navbar sticky="top" bg="my-Blue" variant="dark" id="nav_Links">
        <Navbar.Brand href="#home">
          <img src="./images/icons/favicon.ico" width="30px" height="30px" className="d-inline-block align-top" /> <b>Present Simple</b>
        </Navbar.Brand>

        <Nav className="me-auto">
          <Link to="/">
            <li>HOME</li>
          </Link>
          <Link to="/about">
            <li>ABOUT US</li>
          </Link>
          <Link to="/login">
            <li>LOGIN</li>
          </Link>
          <Link to="/signup">
            <li>SIGN UP</li>
          </Link>
        </Nav>
      </Navbar>
    </div>
  );
};

export default Nav_Bar;
